import React from 'react';
import { useGeolocated } from 'react-geolocated';

// Latitude component
const Latitude = ({ isGeolocationAvailable, isGeolocationEnabled, coords }) => {
  if (!isGeolocationAvailable) {
    return <div>Geolocation is not available</div>;
  }

  if (!isGeolocationEnabled) {
    return <div>Geolocation is not enabled</div>;
  }

  return (
    <div>
      Latitude: { coords.latitude }
    </div>
  );
};

// Longitude component
const Longitude = ({ isGeolocationAvailable, isGeolocationEnabled, coords }) => {
  if (!isGeolocationAvailable) {
    return <div>Geolocation is not available</div>;
  }

  if (!isGeolocationEnabled) {
    return <div>Geolocation is not enabled</div>;
  }

  return (
    <div>
      Longitude: {coords.longitude}
    </div>
  );
};

// Main component
const GeolocationComponent = () => {
  const { isGeolocationAvailable, isGeolocationEnabled, coords } = useGeolocated();

  return (
    <div>
      <Latitude isGeolocationAvailable={isGeolocationAvailable} isGeolocationEnabled={isGeolocationEnabled} coords={coords} />
      <Longitude isGeolocationAvailable={isGeolocationAvailable} isGeolocationEnabled={isGeolocationEnabled} coords={coords} />
    </div>
  );
};

export default GeolocationComponent;
